import React from "react";
import './Languages.css'

export default class Languages extends React.Component {
    render () {
        return (
            <div className={'languages'}>
                <h2>LANGUAGES</h2>
                <br/>
                <h3>English B2+ / C1 level</h3>
                <br/>
                <span>Highly proficient in speaking and in writing</span>
            </div>
        )
    }
}
